import React from 'react'
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper,
    TextField
} from '@mui/material';

const Form = () => {
    return (
        <Paper variant='outlined'>
            <Grid2 container component='form' direction='column' spacing={2} sx={{ p: 2 }}>
                <TextField fullWidth name='positive' label='Positive Prompt' />
                <TextField fullWidth name='negative' label='Negative Prompt' />
                <Button type='submit' variant='contained' color='primary'>Generate Image</Button>
            </Grid2>
        </Paper>
    )
}

export default Form
